export const useGetBlogTitle = (url) => {
    const urlPaths = url.split('@sidgangs99/')

    const title = urlPaths?.[1] || ''
    const formatTitle = title.split('-')
    formatTitle.pop()

    return formatTitle.join(' ')
}
